VALUES(1106, 0, 1281, NULL, '2008', '000009', '2008-11-03', '2008-10-18', '2008-10-10', 7000, NULL, 'Locação de vans tipo Sprinter para traslados dos grupos e convidados do aeroporto de Confins até Belo Horizonte (40 km de distância) e também para deslocamentos internos na cidade como hotel, teatro, restaurantes, entrevistas, etc. O período de realização dos espetáculos é de 18 de outubro a 2 de novembro ou seja são no mínimo 16 diárias sendo que o evento necessita mais de 01 van por dia para poder atender os mais de 70 participantes. Apenas uma das companhias convidadas, Maguy Marin da França, é composta de 18 integrantes o que demanda a locação de um micro-onibus. A média de quantidade de vans por dia que o FID precisa é 3 ou seja uma média de 48 diárias (3 vans/dia x 16 dias).', 'SERVICO', 'CONTRATO', 337, 'INSERCAO', '2008-12-20 14:54:18.795', '97153095691');
